prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nIn this problem\
  \ we consider a special type of an auction, which is called the second-price auction.\
  \ As in regular auction n bidders place a bid which is price a bidder ready to pay.\
  \ The auction is closed, that is, each bidder secretly informs the organizer of\
  \ the auction price he is willing to pay. After that, the auction winner is the\
  \ participant who offered the highest price. However, he pay not the price he offers,\
  \ but the highest price among the offers of other participants (hence the name:\
  \ the second-price auction).\n\nWrite a program that reads prices offered by bidders\
  \ and finds the winner and the price he will pay. Consider that all of the offered\
  \ prices are different.\n\nInput\n\nThe first line of the input contains n (2 \u2264\
  \ n \u2264 1000) \u2014 number of bidders. The second line contains n distinct integer\
  \ numbers p1, p2, ... pn, separated by single spaces (1 \u2264 pi \u2264 10000),\
  \ where pi stands for the price offered by the i-th bidder.\n\nOutput\n\nThe single\
  \ output line should contain two integers: index of the winner and the price he\
  \ will pay. Indices are 1-based.\n\nExamples\n\nInput\n\n2\n5 7\n\n\nOutput\n\n\
  2 5\n\n\nInput\n\n3\n10 2 8\n\n\nOutput\n\n1 8\n\n\nInput\n\n6\n3 8 2 9 4 14\n\n\
  \nOutput\n\n6 9\nA: ```a=int(input())\na=list(map(int,input().split()))\nind=a.index(max(a))\n\
  a.sort()\nprint(str(ind+1)+' '+str(a[-2]))```\nQ: Write python code to solve the\
  \ following coding problem that obeys the constraints and passes the example test\
  \ cases. The output code needs to read from and write to standard IO. Please wrap\
  \ your code answer using ```:\nThere is the faculty of Computer Science in Berland.\
  \ In the social net \"TheContact!\" for each course of this faculty there is the\
  \ special group whose name equals the year of university entrance of corresponding\
  \ course of students at the university. \n\nEach of students joins the group of\
  \ his course and joins all groups for which the year of student's university entrance\
  \ differs by no more than x from the year of university entrance of this student,\
  \ where x \u2014 some non-negative integer. A value x is not given, but it can be\
  \ uniquely determined from the available data. Note that students don't join other\
  \ groups. \n\nYou are given the list of groups which the student Igor joined. According\
  \ to this information you need to determine the year of Igor's university entrance.\n\
  \nInput\n\nThe first line contains the positive odd integer n (1 \u2264 n \u2264\
  \ 5) \u2014 the number of groups which Igor joined. \n\nThe next line contains n\
  \ distinct integers a1, a2, ..., an (2010 \u2264 ai \u2264 2100) \u2014 years of\
  \ student's university entrance for each group in which Igor is the member.\n\n\
  It is guaranteed that the input data is correct and the answer always exists. Groups\
  \ are given randomly.\n\nOutput\n\nPrint the year of Igor's university entrance.\
  \ \n\nExamples\n\nInput\n\n3\n2014 2016 2015\n\n\nOutput\n\n2015\n\n\nInput\n\n\
  1\n2050\n\n\nOutput\n\n2050\n\nNote\n\nIn the first test the value x = 1. Igor entered\
  \ the university in 2015. So he joined groups members of which are students who\
  \ entered the university in 2014, 2015 and 2016.\n\nIn the second test the value\
  \ x = 0. Igor entered only the group which corresponds to the year of his university\
  \ entrance. \nA: ```n = int(input())\na = list(map(int, input().split()))\na.sort()\n\
  if n % 2:\n    print(a[n//2])```\nQ: Write python code to solve the following coding\
  \ problem that obeys the constraints and passes the example test cases. The output\
  \ code needs to read from and write to standard IO. Please wrap your code answer\
  \ using ```:\nOmkar is creating a mosaic using colored square tiles, which he places\
  \ in an n \xD7 n grid. When the mosaic is complete, each cell in the grid will have\
  \ either a glaucous or sinoper tile. However, currently he has only placed tiles\
  \ in some cells. \n\nA completed mosaic will be a mastapeece if and only if each\
  \ tile is adjacent to exactly 2 tiles of the same color (2 tiles are adjacent if\
  \ they share a side.) Omkar wants to fill the rest of the tiles so that the mosaic\
  \ becomes a mastapeece. Now he is wondering, is the way to do this unique, and if\
  \ it is, what is it?\n\nInput\n\nThe first line contains a single integer n (1 \u2264\
  \ n \u2264 2000).\n\nThen follow n lines with n characters in each line. The i-th\
  \ character in the j-th line corresponds to the cell in row i and column j of the\
  \ grid, and will be S if Omkar has placed a sinoper tile in this cell, G if Omkar\
  \ has placed a glaucous tile, . if it's empty. \n\nOutput\n\nOn the first line,\
  \ print UNIQUE if there is a unique way to get a mastapeece, NONE if Omkar cannot\
  \ create any, and MULTIPLE if there is more than one way to do so. All letters must\
  \ be uppercase.\n\nIf you print UNIQUE, then print n additional lines with n characters\
  \ in each line, such that the i-th character in the j^{th} line is S if the tile\
  \ in row i and column j of the mastapeece is sinoper, and G if it is glaucous. \n\
  \nExamples\n\nInput\n\n\n4\nS...\n..G.\n....\n...S\n\n\nOutput\n\n\nMULTIPLE\n\n\
  \nInput\n\n\n6\nS.....\n....G.\n..S...\n.....S\n....G.\nG.....\n\n\nOutput\n\n\n\
  NONE\n\n\nInput\n\n\n10\n.S....S...\n..........\n...SSS....\n..........\n..........\n\
  ...GS.....\n....G...G.\n..........\n......G...\n..........\n\n\nOutput\n\n\nUNIQUE\n\
  SSSSSSSSSS\nSGGGGGGGGS\nSGSSSSSSGS\nSGSGGGGSGS\nSGSGSSGSGS\nSGSGSSGSGS\nSGSGGGGSGS\n\
  SGSSSSSSGS\nSGGGGGGGGS\nSSSSSSSSSS\n\n\nInput\n\n\n1\n.\n\n\nOutput\n\n\nNONE\n\n\
  Note\n\nFor the first test case, Omkar can make the mastapeeces\n\nSSSS\n\nSGGS\n\
  \nSGGS\n\nSSSS\n\nand \n\nSSGG\n\nSSGG\n\nGGSS\n\nGGSS.\n\nFor the second test case,\
  \ it can be proven that it is impossible for Omkar to add tiles to create a mastapeece.\n\
  \nFor the third case, it can be proven that the given mastapeece is the only mastapeece\
  \ Omkar can create by adding tiles.\n\nFor the fourth test case, it's clearly impossible\
  \ for the only tile in any mosaic Omkar creates to be adjacent to two tiles of the\
  \ same color, as it will be adjacent to 0 tiles total. \nA:"
