- " ```import collections\nfrom collections import defaultdict\n\ndef is_valid(n,\
  \ grid):\n    for i in range(n):\n        for j in range(n):\n            if grid[i][j]\
  \ == '.':\n                continue\n            count = 0\n            for x, y\
  \ in [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]:\n                if 0 <= x < n and\
  \ 0 <= y < n:\n                    if grid[x][y] == grid[i][j]:\n              \
  \          count += 1\n            if count != 2:\n                return False\n\
  \    return True\n\ndef count_adjacent(n, grid):\n    count = defaultdict(int)\n\
  \    for i in range(n):\n        for j in range(n):\n            if grid[i][j] ==\
  \ '.':\n                continue\n            count[grid[i][j]] += 1\n         \
  \   for x, y in [(i-1, j), (i+1, j), (i, j-1), (i, j+1)]:\n                if 0\
  \ <= x < n and 0 <= y < n:\n                    if grid[x][y] == grid[i][j]:\n \
  \                       count[grid[i][j]] += 1\n    return count\n\ndef solve(n,\
  \ grid):\n    adjacent = count_adjacent(n, grid)\n    if sum(adjacent.values())\
  \ != 4*n:\n        return 'MULTIPLE'\n    if not is_valid(n, grid):\n        return\
  \ 'NONE'\n    return 'UNIQUE'\n\nn = int(input())\ngrid = [list(input()) for _ in\
  \ range(n)]\nif n == 1:\n    if grid[0][0] == '.':\n        print('NONE')\n    else:\n\
  \        print('UNIQUE')\n        print(grid[0][0])\nelse:\n    print(solve(n, grid))\n\
  \    if solve(n, grid) == 'UNIQUE':\n        for i in range(n):\n            for\
  \ j in range(n):\n                if grid[i][j] == '.':\n                    if\
  \ adjacent[n-1-i][n-1-j] == 'S':\n                        grid[i][j] = 'G'\n   \
  \                 else:\n                        grid[i][j] = 'S'\n        for row\
  \ in grid:\n            print(''.join(row))````\nQ:"
- " ```from collections import deque\nn = int(input())\ngrid = [input() for _ in range(n)]\n\
  count = [[0]*n for _ in range(n)]\nfor i in range(n):\n    for j in range(n):\n\
  \        if grid[i][j] == '.':\n            count[i][j] = 1\n        elif grid[i][j]\
  \ == 'S':\n            count[i][j] = 2\n        else:\n            count[i][j] =\
  \ 3\ndirections = [(0, 1), (0, -1), (1, 0), (-1, 0)]\nfor i in range(n):\n    for\
  \ j in range(n):\n        if count[i][j] == 1:\n            for dx, dy in directions:\n\
  \                x, y = i+dx, j+dy\n                if 0 <= x < n and 0 <= y < n\
  \ and grid[x][y] != '.':\n                    count[x][y] += 1\nfor i in range(n):\n\
  \    for j in range(n):\n        if count[i][j] == 1:\n            queue = deque([(i,\
  \ j)])\n            while queue:\n                x, y = queue.popleft()\n     \
  \           if count[x][y] == 1:\n                    grid[x] = grid[x][:y] + 'S'\
  \ + grid[x][y+1:]\n                    grid[x] = grid[x][:y] + 'G' + grid[x][y+1:]\n\
  \                    count[x][y] = 2\n                elif count[x][y] == 2:\n \
  \                   grid[x] = grid[x][:y] + 'G' + grid[x][y+1:]\n              \
  \      count[x][y] = 3\n                else:\n                    for dx, dy in\
  \ directions:\n                        nx, ny = x+dx, y+dy\n                   \
  \     if 0 <= nx < n and 0 <= ny < n and grid[nx][ny] != '.':\n                \
  \            if count[nx][ny] == 1:\n                                queue.append((nx,\
  \ ny))\n                            else:\n                                grid[nx]\
  \ = grid[nx][:ny] + 'S' + grid[nx][ny+1:]\n                                grid[nx]\
  \ = grid[nx][:ny] + 'G' + grid[nx][ny+1:]\n                                count[nx][ny]\
  \ = 3\nif any(count[i][j] == 1 for i in range(n) for j in range(n)):\n    print('NONE')\n\
  else:\n    print('UNIQUE')\n    for row in grid:\n        print(row)```\nQ:"
